import React from 'react';

function Login() {

    return(
        <section className="login">
            <h2 className="login__welcome">Вход</h2>
            <form className="login__form">

                <input id="username" required name="username" type="text"/>

                <input id="password" required name="password" type="password"  />

                <button type="submit" className="button login__button">Войти</button>

            </form>

            <div className="login__signup">
                <p>Ещё не зарегистрированы?</p>
            </div>
        </section>
    );
}

export default Login;
